import React from "react";
import SkillCard from "./SkillCard";
import Reactjs from "../images/React-icon.svg.png";
import JavaScript from "../images/png-transparent-react-logo-javascript-redux-vuejs-angular-angularjs-expressjs-front-and-back-ends.png";
import Mongo from "../images/mongo.jpg";
import Express from "../images/express.png";
import Node from "../images/node.png";
import Css from "../images/css.png";
import Html from "../images/html.png";
import Tailwind from "../images/tailwind.jpg";
import Next from "../images/nextjs.jpeg";
import Axios from "../images/axios.png";
import Handlebars from "../images/handlebars.webp";

export default function Skills() {
  return (
    <div className="">
      <h1 className="text-center">Skills</h1>
      <h2 className="text-center p-8">
        My stack is MERN. Mongo, Express, React & Node. I also use all the
        folowing technologies.
      </h2>
      <div className="flex ">
        <SkillCard image={Reactjs} name={"React"} />
        <SkillCard image={JavaScript} name={"JavaScript"} />
        <SkillCard image={Mongo} name={"Mongo"} />
        <SkillCard image={Express} name={"Express"} />
        <SkillCard image={Node} name={"Node"} />
        <SkillCard image={Css} name={"Css"} />
        <SkillCard image={Html} name={"Html"} />
        <SkillCard image={Tailwind} name={"Tailwind"} />
        <SkillCard image={Next} name={"Next"} />
        <SkillCard image={Axios} name={"Axios"} />
        <SkillCard image={Handlebars} />
      </div>
    </div>
  );
}
